import React, { useEffect,useState } from 'react';
import { FlatList, SafeAreaView, StatusBar, StyleSheet, Text, TouchableOpacity,View } from "react-native";
import {Input,Button ,ListItem,Header} from 'react-native-elements';
import { useNavigation,useNavigationState } from '@react-navigation/native';


export default function ListaScreen({route,navigation}){

  const [getData, setData] = useState([]);

  useEffect(()=>{

      async function resgatarDados(){
          const result = await axios(
              'http://professornilson.com/testeservico/clientes',
            );
            setData(result.data);
      }
      resgatarDados();
  })

  return(
<View>
  <Header

          centerComponent={{ text: 'Lista', style: { color: '#fff', fontSize:20 } }}
          rightComponent={
              <Button  
              title="+"
              onPress={()=>navigation.navigate('Cadastrar')}
              ></Button>}
 />
 {
  getData.map((linha, i) => (
    <ListItem
      key={i}
      leftAvatar={{ source: { uri: 'https://s3.amazonaws.com/uifaces/faces/twitter/adhamdannaway/128.jpg' } }}
      title={linha.nome}
      subtitle={linha.cpf}
      bottomDivider
      onPress={()=>navigation.navigate('Cadastrar',{
         nome:linha.nome,
         telefone:linha.telefone,
         cpf:linha.cpf,
         id:linha.id,
         alterar:true 
      })}
      chevron
    />
  ))
}

</View>
  )
}
